const TYPED_ARRAY_MAP = {
            f8: Float64Array,
            f4: Float32Array,
            i4: Int32Array,
            i2: Int16Array,
            i1: Int8Array,
            u4: Uint32Array,
            u2: Uint16Array,
            u1: Uint8Array
        };

        function decodeTypedArrays(value) {
            if (Array.isArray(value)) {
                for (let i = 0; i < value.length; i += 1) {
                    value[i] = decodeTypedArrays(value[i]);
                }
                return value;
            }
            if (value && typeof value === 'object') {
                if ('dtype' in value && 'bdata' in value) {
                    return convertTypedArray(value);
                }
                for (const key of Object.keys(value)) {
                    value[key] = decodeTypedArrays(value[key]);
                }
            }
            return value;
        }

        function convertTypedArray({ dtype, bdata }) {
            const buffer = base64ToArrayBuffer(bdata);
            const TypedArrayConstructor = TYPED_ARRAY_MAP[dtype];
            if (!TypedArrayConstructor) {
                console.warn(`Tipo de dato no soportado: ${dtype}`);
                return [];
            }
            const typedValues = new TypedArrayConstructor(buffer);
            return Array.from(typedValues, (val) => Number(val));
        }

        function base64ToArrayBuffer(base64) {
            const binaryString = window.atob(base64);
            const len = binaryString.length;
            const bytes = new Uint8Array(len);
            for (let i = 0; i < len; i += 1) {
                bytes[i] = binaryString.charCodeAt(i);
            }
            return bytes.buffer;
        }

        function decodeBase64Json(encoded) {
            const json = window.atob(encoded);
            return JSON.parse(json);
        }

        function loadFigureFromBase64(dataB64, layoutB64) {
            const data = decodeBase64Json(dataB64);
            const layout = decodeBase64Json(layoutB64);
            decodeTypedArrays(data);
            decodeTypedArrays(layout);
            return { data, layout };
        }

