function showStatusMessage(message, type = 'info') {
    const statusEl = document.getElementById('status-message');
    if (!statusEl) {
        return;
    }

    if (!message) {
        statusEl.textContent = '';
        statusEl.className = 'status-message';
        statusEl.style.display = 'none';
        return;
    }

    statusEl.textContent = message;
    statusEl.className = `status-message status-${type}`;
    statusEl.style.display = 'block';
}

function initConfigurationPanel() {
    const titleInput = document.getElementById('title-input');
    const subtitleInput = document.getElementById('subtitle-input');
    const footerInput = document.getElementById('footer-input');
    const dataInput = document.getElementById('data-input');
    const applyBtn = document.getElementById('apply-config-btn');
    const loadExampleBtn = document.getElementById('load-example-btn');

    if (!(titleInput && subtitleInput && footerInput && dataInput && applyBtn)) {
        return;
    }

    const applyConfiguration = () => {
        const updates = [];

        const titleValue = titleInput.value.trim();
        if (titleValue) {
            const titleEl = document.getElementById('main-title');
            if (titleEl) {
                titleEl.textContent = titleValue;
            }
            updates.push('ttulo');
        }

        const subtitleValue = subtitleInput.value.trim();
        if (subtitleValue) {
            const subtitleEl = document.getElementById('subtitle');
            if (subtitleEl) {
                subtitleEl.textContent = subtitleValue;
            }
            updates.push('subttulo');
        }

        const footerValue = footerInput.value.trim();
        if (footerValue) {
            const footerEl = document.getElementById('footer-text');
            if (footerEl) {
                footerEl.innerHTML = footerValue.replace(/\n/g, '<br>');
            }
            updates.push('pie de pgina');
        }

        const rawJson = dataInput.value.trim();
        if (rawJson) {
            try {
                JSON.parse(rawJson);
                updates.push('datos JSON');
            } catch (error) {
                showStatusMessage('El JSON ingresado no es vlido. Revisa la sintaxis.', 'error');
                return;
            }
        }

        if (updates.length === 0) {
            showStatusMessage('No hay cambios para aplicar.', 'info');
            return;
        }

        showStatusMessage(`Configuracin aplicada a ${updates.join(', ')}.`, 'success');
    };

    const loadExampleData = () => {
        dataInput.value = JSON.stringify(EXAMPLE_JSON_DATA, null, 2);
        showStatusMessage('Ejemplo de datos de visualizacin cargado.', 'info');
    };

    applyBtn.addEventListener('click', applyConfiguration);
    loadExampleBtn?.addEventListener('click', loadExampleData);
    showStatusMessage('', 'info');
}

